import React from 'react';
import ReactDOM from 'react-dom';
import FriendRequestComponent from './friendRequest';

console.log(document.getElementById('friend-request-root')) //debug

const rootElement = document.getElementById('friend-request-root');
const userId = rootElement.getAttribute('data-user-id');
ReactDOM.render(
  <React.StrictMode>
    <FriendRequestComponent userId={userId} />
  </React.StrictMode>,
  document.getElementById('friend-request-root')
);
